window.bookSummaryJSON = "<p>A quiet living, slice of life LitRPG about farming.</p> <p>Things have changed in Summer Shandy, but the more things change, the more they stay the same.</p> <p>For Jason Hunter it’s no different. His third year on the farm starts like any other.</p> <p>With an alarm and his starting actions. But this year, he’ll need to focus not just on the farm, but on his relationship.</p>"; 
